import axios from 'axios';
import React, { useLayoutEffect } from 'react'
import Products from './Products'

import { Component } from 'react'
let pro = []
class Home extends Component {

  constructor(props) {
    super(props)

    this.state = {
      products: []
    }
  }

  componentDidMount() {
    axios.get("http://localhost:8080/products/getAllProducts")
      .then(response => {
        this.setState({
          products: response.data
        })
        // pro = response.data
      })
      .catch(error => {
        console.log(error)
      })

  }

  renderProducts = () => {
    return  this.state.products.map(person => <Products key={person.id} person={person} />);
  }

  render() {
    // const productList = this.state.products.map(person => <Products key={person.id} person={person} />)
    return (
      <div className='d-flex flex-row flex-wrap'>
        {this.renderProducts()}
      </div>
    )
  }
}

export default Home

